function Assessment(props) {
  const titleData = props.data || []; // Ensure titleData is at least an empty array
  const percentage = props.percentage;
  const kind = props.kind;
  let description = '';

  const descriptions = {
      'E': 'Extroverted',
      'I': 'Introverted',
      'S': 'Sensing',
      'N': 'Intuitive',
      'T': 'Thinking',
      'F': 'Feeling',
      'J': 'Judging',
      'P': 'Perceiving'
  };

  // Add checks to ensure titleData has the expected elements
  const first = titleData.length > 0 ? titleData[0].key : '';
  const second = titleData.length > 1 ? titleData[1].key : '';

  if (descriptions[first] && descriptions[first] !== kind) {
      description = descriptions[first];
  } else if (descriptions[second] && descriptions[second] !== kind) {
      description = descriptions[second];
  } else {
      description = 'no input!';
  }

  // Construct class names based on the first key of the data
  const className = first.toLowerCase() + 'circle';
  const firstLetterLower = className.replace('circle', '');

  return (
      <div className="assessment-container">
          <div className="desc" id={firstLetterLower}>
              <p>
                  You are <b>{percentage}%</b> more <b><em>{kind}</em></b> than {description}.
              </p>
          </div>
      </div>
  );
}

